import React from "react";
import '../App.css';
import ElementPrerequis from "./elementPrerequis";
function Prerequis(){
        return(
            <ul>
                <ElementPrerequis id="html" nom="HTML" image="/img/html.png" />
                <ElementPrerequis id="css" nom="CSS" image="/img/css-3-logo.png" />
                <ElementPrerequis id="javascript" nom="JAVASCRIPT" image="/img/JavaS" />
            </ul>
        )
}
export default Prerequis;
